import React from "react";
import { Box, Button, Container, Typography, useTheme } from "@mui/material";

const Landing = () => {
  const theme = useTheme();

  return (
    <Box
      sx={{
        background: theme.palette.landing.gradients.primaryGradient,
        py: 8,
        display: "inline-block",
      }}
    >
      <Container maxWidth="sm" sx={{ display: "inline-block" }}>
        <Typography
          variant="h2"
          align="center"
          sx={{ color: "#fff" }}
          gutterBottom
        >
          Welcome to Slaughterhouse
        </Typography>
      </Container>
    </Box>
  );
};

export default Landing;
